function ChatButtons () {
    return (
        <div id="conversation_icons">
            <img className="icon" src="/icons/phone_icon.png"></img>
            <img className="icon" src="icons/video_icon.png"></img>
            <img className="icon" src="icons/search_icon.png"></img>
            <img id="dots_icon" className="icon" src="icons/dots_icon.png"></img>
        </div>
    );
}

export default ChatButtons;
